  \"Organochlorine pesticides, PCBs, dioxins and metals in post-term peregrine falcon
  (Falco peregrinus) eggs from the mid-Atlantic states: New Jersey, Pennsylvania,
  Delaware, Maryland, and Virginia: 1993-1999\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  14,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:14.569001\",\n\t\"name\": \"organochlorine-pesticides-pcbs-dioxins-and-metals-in-post-term-peregrine-falcon-falco-1993\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"For Peregrine falcons represented by post-term
  egg residues in this study, eggshell thicknesses (n = 93) were not at levels known
  to be critical for effects to next success. There was no statistically significant
  effect of contaminants on next success (n, clutches =73). DDE remained negatively
  correlated with thickness. Residues of persistent organochlorines, PCBs and metals
  were detected in these post-term eggs; some residues approach critical levels for
  effects to birds. Enacting a sampling plan of the breeding population for the Mid-Western/Northeastern
  Recovery Region, as described in the Monitoring Plan for the American Peregrine
  Falcon (USFWS 2003), is advisable. Promoting peregrine falcon nesting in the historic
  inland habitat in the coastal states is advisable as the coastal nesters appear
  to bear higher contaminant burdens than those peregrine falcons that forage inland
  or on more resident prey populations. The coastal nesting peregrines may be accumulating
  contaminants at higher levels than inland nesting birds due to the somewhat more
  migrant coastal prey base that may be exposed to bioaccumulative contaminants in
  many locations. Implementing a randomized egg sampling regime, in accordance with
  provisions in the Monitoring Plan, would encompass the entire recovery region population
  and include greater representation from peregrines nesting in more historic habitat.
  Comprehensive records on number of eggs laid, hatchlings and fledglings at banding
  would facilitate a more detailed analysis of contaminant effects on productivity
  as number of nestlings, rather than as successful (>1 chicks at banding) or unsuccessful
  (0 chicks at banding) nesting. Tracking banded female productivity over a number
  of years, analyzing eggs on a periodic basis, and tracking winter migration routes
  and areas of females, although many peregrines falcons in this region are non-migratory,
  would also allow examination of contaminant trends over time and perhaps discern
  effects due to foraging and environmental factors.\",\n\t\"license_title\": \"License
